import React from "react";
import Contact from "../components/Contact";
import NavigationBar from "../components/NavigationBar";
import Footer from "../components/Footer";

const ContactPage = () => {
  return (
    <>
      <NavigationBar />
      <Contact />
      <Footer />
    </>
  );
};

export default ContactPage;
